    puts "Hello, #{name}!"
end

greet "John"
```

**Compiled Languages:**

*   C (C code)

    ```c
// C example
#include <stdio.h>

void greet(char* name) {
    printf("Hello, %s!\n", name);
}

int main() {
    greet("John");
    return 0;
}
```

*   C++ (C++ code)

    ```cpp
// C++ example
#include <iostream>

void greet(const std::string& name) {
    std::cout << "Hello, " << name << "!\n";
}

int main() {
    greet("John");
    return 0;
}
```

*   Java (Java code)

    ```java
