```java
public class Solution {
    public boolean isPowerOfThree(int n) {
        // 3^0 = 1, 3^1 = 3, 3^2 = 9, 3^3 = 27,...
        // The key observation here is that 3^x can be expressed as 3^(x-1) * 3
        // Therefore, we can reduce the problem to checking if n can be expressed as 3^x, 
        // where x is a non-negative integer.

        // If n is less than 1, it cannot be expressed as 3^x for any x.
        if (n < 1) return false;

        // We use a while loop to continuously divide n by 3, as long as n is divisible by 3.
        while (n % 3 == 0) {
            // If n is divisible by 3, we divide it by 3 and move to the next iteration.
            n /= 3;
        }

        // If n is 1 at the end of the loop, then it can be expressed as 3^x for some x.
        return n == 1;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.isPowerOfThree(27));  // Output: true
        System.out.println(solution.isPowerOfThree(0));  // Output: false
        System.out.println(solution.isPowerOfThree(-1)); // Output: false
    }
}
```

This solution has a time complexity of O(log n) and a space complexity of O(1), as it only uses a constant amount of space to store the input and output values. It does not use recursion, as requested.

